import React from 'react';
import ReactDOM from 'react-dom';
import './Logo.css';
import maislogo from "../../../img/mais.png"

class Logo extends React.Component {
  render() {
    return (
      <div id="logoImage" class="col-12" >
        <img className="img-fluid first col-6 ml-5 mt-4" src={require('../../../img/newLogo1.png')} alt="mais" />
        <div className="myPic">
          <img className="img-fluid second rounded col-6" src={maislogo} alt="logo" />
        </div>
      </div>
    );
  }
}

export default Logo;
